import React from 'react';
import styled from "styled-components";
import {Container, Subtitle, Title} from "../../styles/common";

const StyledBanners = styled(Container)`
  padding-top: 9rem;
  padding-bottom: 9rem;
  display: flex;
  justify-content: space-between;
  gap: 2rem;
`

const Banner = styled.div`
  background-image: url("../../img/banners/${props => props.$backgroundImage}");
  
`

function Banners() {
  return (
    <StyledBanners>
      <Banner $backgroundImage="banner-1.svg">
        <Subtitle $color="">Natural!!</Subtitle>
        <Title>Get Garden Fresh Fruits</Title>
      </Banner>
      <Banner $backgroundImage="banner-2.svg">

      </Banner>
    </StyledBanners>
  );
}

export default Banners;
